-- Drop table

DROP TABLE Position;

CREATE TABLE Position (
	ID BIGINT  NOT NULL,
	AsOfDate DATE,
	EndOfDayPrice DOUBLE,
	MarketValue DOUBLE,
	PositionCurrency VARCHAR(50),
	PreviousEndOfDayPrice DOUBLE,
	Quantity DOUBLE,
	SecurityID VARCHAR(50),
	StartOfDayPosition DOUBLE,
	StartOfDayPrice DOUBLE,
	TradeSettleAmount DOUBLE,
	TradingBook VARCHAR(50),
	createTimeStamp TIMESTAMP,
	createUser VARCHAR(50),
	updateTimeStamp TIMESTAMP,
	updateUser VARCHAR(50),
	CONSTRAINT RowIDField_As_PKey PRIMARY KEY (ID)
);
CREATE UNIQUE INDEX IDKEY_Position ON Position (ID);
CREATE INDEX PositionIndex ON Position (AsOfDate,TradingBook,SecurityID);

